"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Narcotic pain medicines (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H882443524\">",
"      <span class=\"h1\">",
"       What are narcotic pain medicines?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Narcotic pain medicines are a group of medicines that relieve pain. Some of these medicines are made from a plant called the poppy plant. There are also many man-made (also called synthetic) versions of narcotic pain medicines.",
"     </p>",
"     <p>",
"      Doctors refer to narcotic pain medicines as &ldquo;opioids.&rdquo; Here they will be called just &ldquo;narcotics.&rdquo;",
"     </p>",
"     <p>",
"      Narcotics come in lots of different forms, including:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Pills and liquids that you swallow",
"       </li>",
"       <li>",
"        Lozenges and sprays that go in your mouth",
"       </li>",
"       <li>",
"        Patches that you wear on your skin",
"       </li>",
"       <li>",
"        Liquids that are given as a shot or into a thin tube that goes into a vein, called an IV",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      The table lists the names of some common narcotics (",
"      <a class=\"graphic graphic_table graphicRef85592 \" href=\"UTD.htm?16/11/16571\">",
"       table 1",
"      </a>",
"      ).",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H882443539\">",
"      <span class=\"h1\">",
"       When are narcotics used?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Narcotics are used to treat severe pain caused by all sorts of medical problems and injuries. They are also used to manage pain after surgery. Some narcotic medicines can be used to treat a bad cough. Plus, narcotics can help control a symptom called &ldquo;air hunger&rdquo; in people who have serious breathing problems. Air hunger is when you feel like you can&rsquo;t get enough air.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H882443554\">",
"      <span class=\"h1\">",
"       Are all narcotics the same?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes and no. All narcotics work on the same chemical process in the body, but they do it in different ways. Some narcotics need to be taken more often during the day than others to work for certain kinds of pain. And some are more likely than others to cause certain side effects. Plus, the effects of narcotics are different depending on whether they come in a pill, a patch, a shot, or in some other way.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H882443586\">",
"      <span class=\"h1\">",
"       Are narcotics safe for everyone?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Narcotics are safe for most people who need them for severe pain. If you take these medicines, take",
"      <strong>",
"       ONLY",
"      </strong>",
"      the amount prescribed and only as often as prescribed. Do not chew, cut, or crush pills or capsules that release medicine slowly.",
"     </p>",
"     <p>",
"      People who had a severe reaction to 1 narcotic should not take the same narcotic again. People with certain health conditions must use narcotics with care or take smaller doses. That includes people who have breathing problems, or heart, kidney, or liver disease, and people who are older or weak.",
"     </p>",
"     <p>",
"      People who have a history of drug abuse must also use narcotics with care. They should avoid narcotics if possible. But if they need the medicines to treat severe pain, they should seek the help of a pain specialist.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H882443603\">",
"      <span class=\"h1\">",
"       What side effects can narcotics cause?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Narcotics can cause some side effects that are just bothersome and some that are dangerous.",
"     </p>",
"     <p>",
"      Call 9-1-1 for an ambulance or go to the hospital if you (or someone close to you):",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Can&rsquo;t seem to wake up",
"       </li>",
"       <li>",
"        Become very confused",
"       </li>",
"       <li>",
"        Appear to be drowsy and breathing very slowly",
"       </li>",
"       <li>",
"        Pass out or have seizures",
"       </li>",
"       <li>",
"        Become unable to urinate",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Talk to your doctor or nurse if you have any of these side effects and they bother you:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Constipation &ndash; Your doctor or nurse might suggest you take medicines to prevent or treat constipation. It&rsquo;s also important to drink plenty of water.",
"       </li>",
"       <li>",
"        Nausea, vomiting, or itchiness &ndash; If you have any of these problems, your doctor might be able to switch you to a different narcotic.",
"       </li>",
"       <li>",
"        Dry mouth",
"       </li>",
"       <li>",
"        Feel dizzy, sleepy, or have trouble thinking clearly",
"       </li>",
"       <li>",
"        Vision problems",
"       </li>",
"       <li>",
"        Feel clumsy or fall down",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H882443618\">",
"      <span class=\"h1\">",
"       What happens if I take more than the recommended dose?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Taking more than the recommended dose of a narcotic or combining narcotics with other medicines without a doctor&rsquo;s OK can cause serious problems. For example, it can make you pass out or stop breathing.",
"     </p>",
"     <p>",
"      Anybody who takes too much of any medicine at once should call a doctor or the Poison Control Hotline (1-800-222-1222). If the person is not breathing or is not conscious, call 9-1-1 for an ambulance.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H882443633\">",
"      <span class=\"h1\">",
"       Should I worry about addiction?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Taking narcotics to manage pain or other symptoms does not lead to addiction in most people. But it can be a problem for people who have problems with drug or alcohol use.",
"     </p>",
"     <p>",
"      To reduce the chances of addiction, you should:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Never take narcotics that were not prescribed to you.",
"       </li>",
"       <li>",
"        Take narcotics only for as long as your doctor or nurse prescribes, and only at the dose he or she recommends.",
"       </li>",
"       <li>",
"        If the problem for which the narcotics were prescribed gets better, throw away any leftover narcotics. Do not keep old narcotics around the house.",
"       </li>",
"       <li>",
"        Tell your doctor or nurse if the narcotics seem to stop working.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H882443650\">",
"      <span class=\"h1\">",
"       What if I want to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you take narcotics and want to get pregnant, talk to your doctor or nurse before you start trying to get pregnant. Narcotics taken during pregnancy can cause serious problems for the mother and the baby. There might be other ways to control your pain.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H882443665\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
