"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?6/21/6483?source=see_link\">",
"       Patient information: Reducing the costs of medicines (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?2/13/2262?source=see_link\">",
