var title_f11_6_11373="ESC indications for surgery for endocarditis";
var content_f11_6_11373=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F67774&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F67774&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    ESC indications for surgery for endocarditis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Recommendations: Indications for surgery",
"       </td>",
"       <td class=\"subtitle1\">",
"        Timing*",
"       </td>",
"       <td class=\"subtitle1\">",
"        Class",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td class=\"subtitle1\">",
"        Level",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Heart failure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Aortic or mitral IE with severe acute regurgitation or valve obstruction causing refractory pulmonary edema or cardiogenic shock",
"       </td>",
"       <td>",
"        Emergency",
"       </td>",
"       <td>",
"        I",
"       </td>",
"       <td>",
"        B",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Aortic or mitral IE with fistula into a cardiac chamber or pericardium causing refractory pulmonary edema or shock",
"       </td>",
"       <td>",
"        Emergency",
"       </td>",
"       <td>",
"        I",
"       </td>",
"       <td>",
"        B",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Aortic or mitral IE with severe acute regurgitation or valve obstruction and persisting heart failure or echocardiographic signs of poor hemodynamic tolerance (early mitral closure or pulmonary hypertension)",
"       </td>",
"       <td>",
"        Urgent",
"       </td>",
"       <td>",
"        I",
"       </td>",
"       <td>",
"        B",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Aortic or mitral IE with severe regurgitation and no heart failure",
"       </td>",
"       <td>",
"        Elective",
"       </td>",
"       <td>",
"        IIa",
"       </td>",
"       <td>",
"        B",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Uncontrolled infection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Locally uncontrolled infection (abscess, false aneurysm, fistula, enlarging vegetation)",
"       </td>",
"       <td>",
"        Urgent",
"       </td>",
"       <td>",
"        I",
"       </td>",
"       <td>",
"        B",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Persisting fever and positive blood cultures &gt;7 to 10 days",
"       </td>",
"       <td>",
"        Urgent",
"       </td>",
"       <td>",
"        I",
"       </td>",
"       <td>",
"        B",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Infection caused by fungi or multiresistant organisms",
"       </td>",
"       <td>",
"        Urgent/elective",
"       </td>",
"       <td>",
"        I",
"       </td>",
"       <td>",
"        B",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Prevention of embolism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Aortic or mitral IE with large vegetations (&gt;10 mm) following one or more embolic episodes despite appropriate antibiotic therapy",
"       </td>",
"       <td>",
"        Urgent",
"       </td>",
"       <td>",
"        I",
"       </td>",
"       <td>",
"        B",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Aortic or mitral IE with large vegetations (&gt;10 mm) and other predictors of complicated course (heart failure, persistent infection, abscess)",
"       </td>",
"       <td>",
"        Urgent",
"       </td>",
"       <td>",
"        I",
"       </td>",
"       <td>",
"        C",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Isolated very large vegetations (&gt;15 mm)",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td>",
"        Urgent",
"       </td>",
"       <td>",
"        IIb",
"       </td>",
"       <td>",
"        C",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     IE: infective endocarditis.",
"     <br>",
"      * Emergency surgery: surgery performed within 24 h; urgent surgery: within a few days; elective surgery: after at least&nbsp;one or two weeks of antibiotic therapy.",
"      <br>",
"       <font class=\"bullet\">",
"        &bull;",
"       </font>",
"       Class of recommendation.",
"       <br>",
"        &Delta; Level of evidence.",
"        <br>",
"         <font class=\"lozenge\">",
"          &loz;",
"         </font>",
"         Surgery may be preferred if procedure preserving the native valve is feasible.",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Habib G, Hoen B, Tornos P, et al. Guidelines on prevention, diagnosis and treatment of infective endocarditis (new version 2009): the Task Force on the Prevention, Diagnosis, and Treament of Infective Endocarditis of the European Society of Cardiology (ESC). Endorsed by the European Society of Clinical Microbiology and Infectious Diseases (ESCMID) and the International Society of Chemotherapy (ISC) for Infection and Cancer. Eur Heart J 2009; 30:2369, by permission of Oxford University Press. Copyright &copy; 2009.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
