"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Stage IIA",
"       </td>",
"       <td>",
"        T3",
"       </td>",
"       <td>",
"        N0",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
